import React from "react";

const Nav = () => {
  const navlinks = ["Home", "Profile", "Courses", "Result", "Accouts"];
  return (
    <div>
      <h1 className="text-2xl md:text-xl text-red-700">Student Portal</h1>
      <div>
        {navlinks.forEach(link => {
          <span>link[0]</span>;
        })}
      </div>
    </div>
  );
};

export default Nav;
